package com.example.finacleservice.controller;

import com.example.finacleservice.request.TDAccountDetailsRequest;
import com.example.finacleservice.response.TDAccountDetailsResponse;
import org.springframework.web.bind.annotation.*;

@RestController
@RequestMapping("/tdaccountinquiry/enc")
public class TDAccDetailsController {

    @PostMapping(value = "get-td-account-details")
    public TDAccountDetailsResponse getRepaymentAccNum(@RequestBody TDAccountDetailsRequest request) {
        String encResponseSuccess= "";
        TDAccountDetailsResponse.Response response = new TDAccountDetailsResponse.Response(
                new TDAccountDetailsResponse.Header(
                        new TDAccountDetailsResponse.SubHeader(
                                "12345", // Sample requestUUID
                                "AE.ESB.FIN.SSTP.001", // Sample serviceRequestId
                                "1.0", // Sample serviceRequestVersion
                                "ESB" // Sample channelId
                        )
                ),
                new TDAccountDetailsResponse.Body(
                        new TDAccountDetailsResponse.GetTDAccountDetailsResponse(
                                encResponseSuccess // Sample encryptedResponse
                        )
                )
        );

        return new TDAccountDetailsResponse(response);

    }

    @PostMapping(value = "/closeFdRd")
    public String closeFdRd() {
        return "";

    }

}